# -> Result<((SendRequest<Bytes>, Connection<T, Bytes>)), h2::Error>
# {
// `client_fut` is a future representing the completion of the HTTP/2
// handshake.
let client_fut = Builder::new()
    .max_concurrent_reset_streams(1000)
    .handshake(my_io);
# client_fut.await
# }
#
# pub fn main() {}
```

